import Link from "next/link";
const TopNavbar = () => (
  <nav className="navbar">
    <ul className="navbar-nav">
      <li className="nav-item">
        <Link href="/software">
        <a className="nav-link">
        <svg 
          aria-hidden="true" 
          focusable="false" 
          data-prefix="fas" 
          data-icon="desktop" 
          className="svg-inline--fa fa-desktop fa-w-18" 
          role="img" 
          xmlns="http://www.w3.org/2000/svg" 
          viewBox="0 0 576 512"
          className="fa-primary">
          <path 
            fill="currentColor" 
            d="M528 0H48C21.5 0 0 21.5 0 48v320c0 26.5 21.5 48 48 48h192l-16 48h-72c-13.3 0-24 10.7-24 24s10.7 24 24 24h272c13.3 0 24-10.7 24-24s-10.7-24-24-24h-72l-16-48h192c26.5 0 48-21.5 48-48V48c0-26.5-21.5-48-48-48zm-16 352H64V64h448v288z"></path></svg>
          <span className="link-text">Софтвер</span>
        </a>
        </Link>
      </li>
    </ul>
    <style jsx>
    {`
        .navbar {
        position: fixed;
        background-color: var(--bg-primary);
        top: 0;
        width: 5rem;
        height: 100vh;
        }
        .navbar-nav {
          list-style: none;
          padding: 0;
          margin: 0;
          display: flex;
          flex-direction: row;
          justify-content: flex-end;
          align-items: center;
          width: 100%;
        }

        .nav-item {
          width: 100%;
        }
    `}
    </style>
  </nav>
);

export default TopNavbar;
